import styled from "styled-components";

const NavbarStyle = styled.div`
  height: 100px;
  background: #859124;
  padding: 10px 500px;
  display: flex;
  justify-content: space-between;
  align-items: center;

  .cart-container {
    display: flex;
  }
`;

export default NavbarStyle;
